import React from 'react'
import { navigations } from '../../utils/utils'
import { Link } from 'react-router-dom'

const Navbar=()=>{
    return(
        <nav>
            {
               navigations.map((link)=>(
                     <li key={link.id}>
                       <Link to={link.url}>{link.text}</Link>
                   </li>
               ))
            }
        </nav>
    )
}

export default Navbar
